import { useHistory } from 'react-router-dom';

function MyGroups() {
    const [groups, setGroups] = useState([]);
    const history = useHistory();

    useEffect(() => {
        fetchGroups();
    }, []);

    const fetchGroups = () => {
        Axiosinstance.get('/users/groups')
            .then(response => {
                setGroups(response.data);
            })
            .catch(error => {
                console.error('Error fetching groups:', error);
            });
    };

    const viewGroupDetails = (groupId) => {
        // Implement logic to navigate to the group details page
        history.push(`/groups/${groupId}`); // Example URL structure
    };

    return (
        <div>
            <h1>My Groups</h1>
            <ul>
                {groups.map(group => (
                    <li key={group._id}>
                        <button onClick={() => viewGroupDetails(group._id)}>
                            {group.groupName}
                        </button>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default MyGroups;
